import React, { Component } from 'react';
import './App.css';
import Screen from './components/Screen';
import Wrapper from './components/Wrapper';

function App() {

  let vote = 42;
  return(
    <div>
      <Wrapper>
        {Screen(vote)}
      </Wrapper>
    </div>
  );
}

export default App;
